string = ""
str_idx = 0
memory = [0]
memory_idx = 0
opened = -1


for i, char in enumerate(string):  # type: ignore
    if char == 'E':
       memory_idx += 1
       memory.append(0)
    elif char == "N":
       memory_idx -= 1
    elif char == "D":
        memory[memory_idx] += 1
    elif char == "A":
        memory[memory_idx] -= 1
    elif char == "V":
        opened = i
    elif char == "a":
        print(chr(memory[memory_idx]), end="")
